// MyGoogleMaps.js
import React, { Component } from 'react';
import GoogleMapReact from 'google-map-react';
import styled from 'styled-components';
import AutoComplete from './autocomplete';
import Marker from './markers';

var requestOptions = {
    method: 'GET',
  };

const Wrapper = styled.main`
  width: 100%;
  height: 100%;
`;
var axios = require("axios").default;

var options = {
  method: 'GET',
  url: 'https://dev-fp7u5r2i.us.auth0.com/api/v2/users',
  params: {q: 'user_metadata.tutor: "yes"', search_engine: 'v3'},
  headers: {authorization: 'Bearer eyJhbGciOiJSUzI1NiIsInR5cCI6IkpXVCIsImtpZCI6Ik1PLTJQcWR5X3BYRVR2QUxaQWhpMCJ9..B4y9zHQ_yYSc6VsJkYzxGKfz77iALo1iTTacrdr0B_prx7QuAyPg8TTI7DEcOL_eYAYmNb9K3v2ZThaEPRtU2xlXhR6Xs52VYPejKB1m7DEic1s_dNHiqdw3s2vSHtKcfmeqY_FoREYWFXlzQ1jo3HOhu_Gi7vQ4K6VwO3wBHZwIit7nO4QHvhSfT4ctEFpwE7qaYTzf6PcwuoFNs90HZn3yRg9wt2UizcfMzGfaJxA1bD1LDZDLJDwIIHt9EmHR8A89xf69ps2UmJlvn34uUCv6RaY6D3g9OUi4zd4Fl20epVYjTlIz-Zs5CkkPQbROLvRuFcPdQGDL7fGi_wKLOg'}
};

var obj = {
    table: []
};

axios.request(options).then(function (response) {
    for (let i = 0; i < response.length(); ++i) {
        console.log(response.data[i].last_ip);
        fetch(`https://api.geoapify.com/v1/ipinfo?&ip=${response.data[i].last_ip}&apiKey=e1690d731c6a4a7e8bc071f67a045952`, requestOptions)
        .then(response => response.json())
        .then(result => obj.table.push({lat: result.location.latitude, lon: result.location.longitude}))
        .then(result => console.log(result))
        .catch(error => console.log('error', error));
    }
    
  }).catch(function (error) {
    console.error(error);
});
console.log(obj);

class MyGoogleMap extends Component {
    state = {
        mapApiLoaded: false,
        mapInstance: null,
        mapApi: null,
        geoCoder: null,
        places: [],
        center: [],
        zoom: 9,
        address: '',
        draggable: true,
        lat: null,
        lng: null
    };

    componentWillMount() {
        this.setCurrentLocation();
    }


    onMarkerInteraction = (childKey, childProps, mouse) => {
        this.setState({
            draggable: false,
            lat: mouse.lat,
            lng: mouse.lng
        });
    }
    onMarkerInteractionMouseUp = (childKey, childProps, mouse) => {
        this.setState({ draggable: true });
        this._generateAddress();
    }

    _onChange = ({ center, zoom }) => {
        this.setState({
            center: center,
            zoom: zoom,
        });

    }

    _onClick = (value) => {
        this.setState({
            lat: value.lat,
            lng: value.lng
        });
    }

    apiHasLoaded = (map, maps) => {
        this.setState({
            mapApiLoaded: true,
            mapInstance: map,
            mapApi: maps,
        });

        this._generateAddress();
    };

    addPlace = (place) => {
        this.setState({
            places: [place],
            lat: place.geometry.location.lat(),
            lng: place.geometry.location.lng()
        });
        this._generateAddress()
    };

    _generateAddress() {
        const {
            mapApi
        } = this.state;

        const geocoder = new mapApi.Geocoder;

        geocoder.geocode({ 'location': { lat: this.state.lat, lng: this.state.lng } }, (results, status) => {
            console.log(results);
            console.log(status);
            if (status === 'OK') {
                if (results[0]) {
                    this.zoom = 12;
                    this.setState({ address: results[0].formatted_address });
                } else {
                    window.alert('No results found');
                }
            } else {
                window.alert('Geocoder failed due to: ' + status);
            }

        });
    }

    // Get Current Location Coordinates
    setCurrentLocation() {
        if ('geolocation' in navigator) {
            navigator.geolocation.getCurrentPosition((position) => {
                this.setState({
                    center: [position.coords.latitude, position.coords.longitude],
                    lat: position.coords.latitude,
                    lng: position.coords.longitude
                });
            });
        }
    }

    render() {
        const {
            places, mapApiLoaded, mapInstance, mapApi,
        } = this.state;


        return (
            <Wrapper>
                {mapApiLoaded && (
                    <div>
                        <AutoComplete map={mapInstance} mapApi={mapApi} addplace={this.addPlace} />
                    </div>
                )}
                <GoogleMapReact
                    center={this.state.center}
                    zoom={this.state.zoom}
                    draggable={this.state.draggable}
                    onChange={this._onChange}
                    onChildMouseDown={this.onMarkerInteraction}
                    onChildMouseUp={this.onMarkerInteractionMouseUp}
                    onChildMouseMove={this.onMarkerInteraction}
                    onChildClick={() => console.log('child click')}
                    onClick={this._onClick}
                    bootstrapURLKeys={{
                        key: 'AIzaSyCMTMZRfsRntL-3TMJF4muUInsfWEL7JcE',
                        libraries: ['places', 'geometry'],
                    }}
                    yesIWantToUseGoogleMapApiInternals
                    onGoogleApiLoaded={({ map, maps }) => this.apiHasLoaded(map, maps)}
                >

                    <Marker
                        text={this.state.address}
                        lat={this.state.lat}
                        lng={this.state.lng}
                    />


                </GoogleMapReact>

                <div className="info-wrapper">
                    <div className="map-details">Latitude: <span>{this.state.lat}</span>, Longitude: <span>{this.state.lng}</span></div>
                    <div className="map-details">Zoom: <span>{this.state.zoom}</span></div>
                    <div className="map-details">Address: <span>{this.state.address}</span></div>
                </div>


            </Wrapper >
        );
    }
}

export default MyGoogleMap;
